import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        async function fetchData() {
            try {
                const response = await axios.get(`https://perenual.com/api/species-list?key=${process.env.REACT_APP_API_KEY}`);
                setData(response.data);
            } catch (error) {
                console.error("Error fetching data:", error);
            }
        }

        fetchData();
    }, []);

    return (
      <div>
        <div className='header'>
          <h1>Perenual</h1>
          <p>ID #{data.id} {data.common_name}</p>
        </div>
        <h1>API Data</h1>
        <pre>{JSON.stringify(data, null, 2)}</pre>
      </div>
    );
}

export default App;
